fn parse(input: &str) -> (HashSet<&str>, HashMap<&str, Vec<&str>>) {
    let mut nodes = HashSet::new();
    let mut connections = HashMap::new();
    input.lines().for_each(|line| {
        let (label, connected_to) = line.trim().split(": ").tuple_windows().next().unwrap();
        nodes.insert(label);
        connected_to.split(" ").for_each(|node| {
            nodes.insert(node);
            add_value_in_multimap(&mut connections, label, node);
            add_value_in_multimap(&mut connections, node, label);
        });
    });
    (nodes, connections)
}

fn add_value_in_multimap<'a>(map: &mut HashMap<&'a str, Vec<&'a str>>, key: &'a str, value_to_add: &'a str) {
        let mut entry = map.entry(key);
        entry.and_modify(|current| current.push(value_to_add))
            .or_insert(vec![value_to_add]);
}

// fn get_neighbors_exclude<'a>(current: &str, from: &str, connections: &HashMap<&'a str, Vec<&'a str>>) -> Vec<&'a str>{
//     connections.get(current).unwrap_or(&vec![])
//         .iter().cloned()
//         .filter(|&node| node != from)
//         .collect_vec()
// }

fn get_neighbors<'a>(current: &str, connections: &HashMap<&'a str, Vec<&'a str>>) -> Vec<&'a str>{
    connections.get(current).unwrap_or(&vec![]).clone()
}

fn connected_component_size(source: &str, connections: &HashMap<&str, Vec<&str>>) -> usize {
    let mut frontier = VecDeque::from([source]);
    let mut visited = HashSet::from([source]);

    while let Some(current) = frontier.pop_front() {
        for neighbor in get_neighbors(current, connections) {
            if !visited.contains(neighbor) {
                frontier.push_back(neighbor);
                visited.insert(neighbor);
            }
        }
    }
    visited.iter().count()
}

fn remove_edge<'a>(a: &str, b: &str, connections: &mut HashMap<&'a str, Vec<&'a str>>) {
    let value = connections.get_mut(a).unwrap();
    let index = value.iter().position(|&x| x == b).unwrap();
    value.remove(index);
    let value = connections.get_mut(b).unwrap();
    let index = value.iter().position(|&x| x == a).unwrap();
    value.remove(index);
}


